import { Route, BrowserRouter as Router, Routes } from "react-router-dom";

class Body extends Component {
  render() {
    return (
      <Router>
        <Routes>
          <Route path="/" component={Home}></Route>
          <Route path="/about" component={About}></Route>
        </Routes>
      </Router>
    );
  }
}

export default Body;
